  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Meredosia
  National Wildlife Refuge outlines Refuge accomplishments during the 1982 calendar
  year. The report begins with Refuge highlights and climate conditions. Habitat management
  is covered; wetlands, croplands, and wilderness and special areas are discussed.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, migratory birds, mammals, and big game animals. Interpretation
  and recreation activities are outlined; topics include law enforcement. Cooperative
  programs and items of interest are discussed. Photographs are attached.\",\n\t\"license_title\":
